// Layout
import LayoutEspecial from '../Layouts/LayOutMenu';
import layoutMenu from '../Layouts/LayOutMenu';

// Pages

import MenuEspecialidades from '../Pages/AdminRestaurante/Especialidades';
import Login from '../Pages/Login';

const routes = [{

    path: '/Especialidades',
    component: layoutMenu,
    exact: true,
    routes: [
        {
            path: "/Especialidades",
            component: LayoutEspecial,
            exact: true

        }
    ]

},
{
    path: '/',
    component: Login,
    exact: false

}
];


export default routes;
